(163, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:46:\"Elementor Sites of the Month – December 2019\";s:7:\"excerpt\";s:76:\"Here are our top picks of Elementor sites for December 2019. Check them out!\";s:7:\"created\";s:10:\"1578908299\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/showcase-december-2019/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:60:\"Elementor Talks #56: Breaking the Rules of Content Marketing\";s:7:\"excerpt\";s:215:\"Jay Acunzo, a keynote speaker and podcaster, talks about the crucial skills we will be needing in the future, lists 3 Steps to Making Better Decisions, and explains how to translate his approach to everyday life.​\";s:7:\"created\";s:10:\"1577361794\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/podcast-56-jay-acunzo/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:21:\"Showcase Madness 2019\";s:7:\"excerpt\";s:126:\"Welcome to our first annual showcase, where we selected the ten best Elementor sites of the year out of 120 superb contenders!\";s:7:\"created\";s:10:\"1577188998\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:125:\"https://elementor.com/blog/elementor-best-sites-2019/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:45:\"3 Reasons to Choose Theme Builder Over Themes\";s:7:\"excerpt\";s:136:\"This week we customize website elements and take our designs beyond the limitations of themes and into the future of WordPress websites.\";s:7:\"created\";s:10:\"1577088110\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/why-use-theme-builder/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:33:\"Meet the Table of Contents Widget\";s:7:\"excerpt\";s:155:\"Elementor Pro 2.8 brings you an important tool to help improve your site’s user ex